import React from "react";
import "./Projects.scss";

import Domains from "../Project Domains/Domains";

import app from "../../Assets/app.png";
import web from "../../Assets/web.png";
import game from "../../Assets/game.png";
import design from "../../Assets/graphic.png";

const Projects = () => {
    const projects = [
      {
        id: "apps",
        title: "App Development",
        img: app,
      },
      {
        id: "game",
        title: "Game Development",
        img: game,
      },
      {
        id: "designs",
        title: "Graphic Designing",
        img: design,
      },
      {
        id: "web",
        title: "Web Development",
        img: app,
      },
    ];
  return (
    <div class="projects" id="projects">
      <h1>Projects</h1>
      <div class="container">
        <Domains img={app} alt={"app"} title={"App Development"} />
        <Domains img={web} alt={"web"} title={"Web Development"} />
        <Domains img={game} alt={"game"} title={"Game Development"} />
        <Domains img={design} alt={"design"} title={"Graphic Designing"} />
      </div>
    </div>
  );
};

export default Projects;
